import axios from 'axios';

//import './App.css';

function Register() {

  let userInfo = {};

  function handleSignUpChange(e){
    userInfo[e.target.name] = e.target.value;
  }

  function signUp(){
    axios.post(`http://localhost:3020/user/signup`, userInfo)
    .then(function (response) {
      alert(response.data.message);
      console.log(response);
    })
    .catch(function (error) {
      alert(error);
      console.log(error);
    });
  }

  return (
    <div className="editable-form">
      <h4>Create Gruop</h4>
      <hr />
      <div className="form-group">
        <label>Group ID:</label> 
        <input className='form-control' type="text" name="username" onChange={handleSignUpChange} /> 
      </div>
      <div className="form-group">
        <label>Group Name:</label> 
        <input className='form-control' type="password" name="password" onChange={handleSignUpChange} />
      </div>
      <div className="form-group">
        <label>Email:</label> 
        <input className='form-control' type="text" name="email" onChange={handleSignUpChange} />
      </div>
      <div className="form-group">
        <label>Telephone:</label> 
        <input className='form-control' type="text" name="telno" onChange={handleSignUpChange} />
      </div>
      <br />
      <input className="btn btn-primary" type="button" name="btnSignUp" onClick={signUp} value="Sign Up" />
    </div>
  );
}

export default Register;
